function ArtistCard({ artist}) {
  return (
    <div className="card bg-transparent shadow text-white">
      <img className="card-img w-100 h-100" src={artist.images[0].url} alt={artist.name} />
      <div className="card-img-overlay">
        <h5 className="card-title mr-5">{artist.name}</h5>
        <h5 className="card-title">{"#" + artist.ranking}</h5>
        <p className="card-text">
          {artist.desc}
        </p>
      </div>
    </div>
  );
}

export default ArtistCard;
